import axios from 'axios';

export const BASE_PRODUCT_URL = '/produto';

async function post(data, url) {
    return axios({
        method: 'post',
        url,
        data
    });
}

async function get(url, params) {
    return axios.get(
        url,
        params
    );
}

const getProdutos = () => {
    const response = get(BASE_PRODUCT_URL, null);
    response.then(res => {
        console.log(res.data);
    }, err => {
        console.log(err);
    })
}
